// SPDX-License-Identifier: MIT
pragma solidity >=0.8.0;
contract Lottery{
    address private manager;
    address payable [] public players;
    address payable Winner;
    constructor(){
        manager=msg.sender;
    }
    function participate() payable public {
        require(msg.value>100 wei,"atleast give 100 wei");
        players.push(payable(msg.sender));
    }
    function checkBal() public view  returns(uint){
        return address(this).balance;
    }
    function random() public view returns(uint){
      return uint(keccak256(abi.encodePacked(block.prevrandao,block.timestamp,players.length)));
    }
    function win() public{
        require(manager==msg.sender,"you are not the manager");
        require(players.length>3,"not enough players");

        uint r=random();
       uint i= r%players.length;
       Winner=players[i];
      Winner.transfer(checkBal());
    players=new address payable[](0); //resets the lottery
    }

    
}

